webpackJsonp([40261409086093],{3425:function(t,n){t.exports={data:{markdownRemark:{html:"<p><strong>🌡9℃ ☁</strong></p>\n<p>昨日は半ドンなので、学校から帰ってから正月にお年玉として貰った、プラモデルを作りました。\n車の精巧な模型プラモデルです。\nとても難しく、今日一日ではとても間に合いませんでした。</p>\n<p>製作中、塗料や接着剤を使って、シンナー臭が換気してもなかなか消えず、途中気分が悪くなって休憩を挟みながら作業していたので、思った以上に進みませんでした。</p>\n<p>結局 19:30 頃で断念し、翌朝再開してようやく完成しました。</p>\n<p>昼食は家族で外食に行きましたが、両親にやたら臭いと言われました。\nどうやらシンナー臭が体に染み付いてしまったようです。</p>",frontmatter:{cover:null,date:"1991-02-03T21:15:00+09:00",strDate:"1991/2/3",title:"日記"}}},pathContext:{path:"/ja/blog/1991/02/03-diary/",langKey:"ja"}}}});
